import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './pages/Home';
import LandingPage from './pages/LandingPage'; // Importación de LandingPage


const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LandingPage />} /> {/* Ruta para LandingPage */}
        <Route path="/home" element={<Home />} /> {/* Ruta para Home */}
      </Routes>
    </Router>
  );
};

export default App;
